export async function RunModel() {
    // Create session and set options. See the docs here for more options: 
    //https://onnxruntime.ai/docs/api/js/interfaces/InferenceSession.SessionOptions.html#graphOptimizationLevel
    // const session = await ort.InferenceSession.create(modelPath);
    console.log('Start Loading');
    await InferenceSession.create('./squeezenet1_1.onnx')
    console.log('Loaded');
    // Run inference and get results.
    // var [results, inferenceTime] =  await runInference(session, preprocessedData);
    // return [results, inferenceTime];
  }




async function runInference(session: InferenceSession, preprocessedData: any): Promise<[any, number]> {
    // Get start time to calculate inference time.
    const start = new Date();
    const feeds: Record<string, ort.Tensor> = {};
    feeds[session.inputNames[0]] = preprocessedData;
    // Run the session inference.
    const outputData = await session.run(feeds);
    // Get the end time to calculate inference time.
    const end = new Date();
    // Convert to seconds.
    const inferenceTime = (end.getTime() - start.getTime())/1000;
    // Get output results with the output name from the model export.
    const output = outputData[session.outputNames[0]];
    //Get the softmax of the output data. The softmax transforms values to be between 0 and 1
    var output_value = Array.prototype.slice.call(output.data);
    //Get the top 5 results.
    var results = output_value;
    console.log('results: ', results);
    return [results, inferenceTime];
  }

export default RunModel;
